// src/components/admin/HabitacionModal.jsx
import React, { useState, useEffect } from 'react';
import styles from './ReservaModal.module.css'; // Reutilizamos los estilos de la otra modal para consistencia

const HabitacionModal = ({ show, onClose, onSave, habitacion }) => {
    const [formData, setFormData] = useState({
        nombre: '',
        descripcion: '',
        capacidad: '',
        piso: '',
        precio_noche: '',
        servicios: '' // Los servicios se manejarán como un string separado por comas
    });

    useEffect(() => {
        if (habitacion) {
            setFormData({
                nombre: habitacion.nombre,
                descripcion: habitacion.descripcion,
                capacidad: habitacion.capacidad,
                piso: habitacion.piso,
                precio_noche: habitacion.precio_noche,
                servicios: habitacion.servicios.join(', ')
            });
        } else {
            // Resetea el formulario cuando se crea una nueva
            setFormData({
                nombre: '',
                descripcion: '',
                capacidad: '',
                piso: '',
                precio_noche: '',
                servicios: ''
            });
        }
    }, [habitacion, show]);


    if (!show) {
        return null;
    }

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData(prev => ({ ...prev, [name]: value }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Convertimos el string de servicios en un array
        const dataToSave = {
            ...formData,
            servicios: formData.servicios.split(',').map(s => s.trim()).filter(s => s)
        };
        onSave(dataToSave);
    };

    return (
        <div className={styles.modalOverlay}>
            <div className={styles.modalContent}>
                <h2>{habitacion ? 'Editar Habitación' : 'Crear Nueva Habitación'}</h2>
                <form onSubmit={handleSubmit}>
                    <div className={styles.inputGroup}>
                        <label>Nombre</label>
                        <input type="text" name="nombre" value={formData.nombre} onChange={handleChange} required />
                    </div>
                    <div className={styles.inputGroup}>
                        <label>Descripción</label>
                        <textarea name="descripcion" value={formData.descripcion} onChange={handleChange} rows="3" required></textarea>
                    </div>
                    <div className={styles.inputGroup}>
                        <label>Capacidad (personas)</label>
                        <input type="number" name="capacidad" value={formData.capacidad} onChange={handleChange} required />
                    </div>
                    <div className={styles.inputGroup}>
                        <label>Piso</label>
                        <input type="number" name="piso" value={formData.piso} onChange={handleChange} required />
                    </div>
                    <div className={styles.inputGroup}>
                        <label>Precio por Noche</label>
                        <input type="number" name="precio_noche" value={formData.precio_noche} onChange={handleChange} required />
                    </div>
                     <div className={styles.inputGroup}>
                        <label>Servicios (separados por coma)</label>
                        <input type="text" name="servicios" value={formData.servicios} onChange={handleChange} placeholder="WiFi, TV Cable, etc." />
                    </div>
                    <div className={styles.buttonGroup}>
                        <button type="button" onClick={onClose} className={styles.cancelButton}>Cancelar</button>
                        <button type="submit">Guardar Habitación</button>
                    </div>
                </form>
            </div>
        </div>
    );
};

export default HabitacionModal;
